import { GiUnitedStates, GiUnitedKingdom, GiGermany, GiFrance, GiItaly, GiCanada, GiJapan, GiAustralia, GiBrazil, GiIndia } from 'react-icons/gi';

const CountryFlagList = () => {
  // Define an array of country flag icons
  const countryFlags = [
    <GiUnitedStates />,
    <GiUnitedKingdom />,
    <GiGermany />,
    <GiFrance />,
    <GiItaly />,
    <GiCanada />,
    <GiJapan />,
    <GiAustralia />,
    <GiBrazil />,
    <GiIndia />
  ];

  return (
    <div className="flex flex-wrap justify-center items-center">
      {/* Map over the country flags array to render each flag */}
      {countryFlags.map((flag, index) => (
        <div key={index} className="flex items-center justify-center w-1/10 p-2">
          {flag}
        </div>
      ))}
    </div>
  );
};

export default CountryFlagList;
